  [],\n\t\"revision_timestamp\": \"2016-07-27T22:38:28.065053\",\n\t\"name\": \"wheeler-national-wildlife-refuge-narrative-report-january-april-1955\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Wheeler NWR outlines
  Refuge accomplishments from January through April of 1955. The report begins by
  summarizing the weather conditions, water conditions, and food and cover during
  this period. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, raptors, and fish- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, and collections and receipts.
  Resource management is outlined; topics include grazing, haying, fur harvesting,
  and timber removal. A progress report on field investigations and applied research
  is also provided. The public relations section of the report describes recreational
  uses, Refuge visitors, Refuge participation, fishing, and violations. N-R forms
  and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
